int CNav2Bit::GetFrameData(GNSS_TIME StartTime, int svid, int Param, int *NavBits)
{
	int i, j, page, toi, itow;
	unsigned int Stream[19];
	int bits[1748], *p;
	unsigned int *data, value;

	// data channel
	if (svid < 1 || svid > 32)
		return 1;
	page = StartTime.MilliSeconds / 18000;		// frames from week epoch
	itow = page / 400;
	toi = page % 400;
	// assume subframe 3 broadcast first page
	page = 0;

	data = Subframe2[svid-1];
	for (i = 0; i < 18; i ++)
		Stream[i] = data[i];
	// insert WN and ITOW for Subframe2
	Stream[0] |= COMPOSE_BITS(StartTime.Week, 19, 13);
	Stream[0] |= COMPOSE_BITS(itow, 11, 8);
	// generate CRC for subframe2
	Stream[18] = Crc24qEncode(Stream, 576) << 8;
	LDPCEncode(Stream, bits, L1C_SUBFRAME2_SYMBOL_LENGTH, 19, L1CMatrixGen2);		// do LDPC encode

	// generate CRC for subframe3
	data = Subframe3[page];	// assume CRC has already appended to end
	LDPCEncode(data, bits + 1200, L1C_SUBFRAME3_SYMBOL_LENGTH, 9, L1CMatrixGen3);		// do LDPC encode

	// do interleaving
	p = NavBits + 52;
	for (i = 0; i < 46; i ++)
		for (j = 0; j < 38; j ++)
			*p ++ = bits[j * 46 + i];

	// add subframe 1
	NavBits[0] = (toi & 0x100) ? 1 : 0;	// MSB of TOI
	value = (unsigned int)(BCH_toi_table[toi & 0xff] >> 32);
	AssignBits(value, 19, NavBits + 1);
	value = (unsigned int)(BCH_toi_table[toi & 0xff]);
	AssignBits(value, 32, NavBits + 20);
	return 0;
}

int CNav2Bit::SetEphemeris(int svid, PGPS_EPHEMERIS Eph)
{
	if (svid < 1 || svid > 32 || !Eph || !Eph->valid)
		return 0;
	ComposeSubframe2(Eph, Subframe2[svid-1]);
	return svid;
}

// 576 bits subframe information divided int 18 DWORDs
// each DWORD has 32bits with bit order MSB first and least index first
void CNav2Bit::ComposeSubframe2(PGPS_EPHEMERIS Eph, unsigned int Subframe2[18])
{
	signed int IntValue;
	unsigned int UintValue;
	long long int LongValue;
	unsigned long long int ULongValue;

	Subframe2[0] = COMPOSE_BITS(Eph->top / 300, 0, 11);
	Subframe2[1] = (Eph->health & 0x100) ? 0x80000000 : 0;
	Subframe2[1] |= COMPOSE_BITS(Eph->ura, 26, 5);
	Subframe2[1] |= COMPOSE_BITS(Eph->toe / 300, 15, 11);
	IntValue = UnscaleInt(Eph->axis - 26559710.0, -9);	// deltaA
	Subframe2[1] |= COMPOSE_BITS(IntValue >> 15, 0, 15);
	Subframe2[2] = COMPOSE_BITS(IntValue, 21, 11);
	IntValue = UnscaleInt(Eph->axis_dot, -21);	// Adot
	Subframe2[2] |= COMPOSE_BITS(IntValue >> 4, 0, 21);
	Subframe2[3] = COMPOSE_BITS(IntValue, 28, 4);
	IntValue = UnscaleInt(Eph->delta_n / PI, -44);	// delta_n
	Subframe2[3] |= COMPOSE_BITS(IntValue, 11, 17);
	IntValue = UnscaleInt(Eph->delta_n_dot, -57);	// delta n dot
	Subframe2[3] |= COMPOSE_BITS(IntValue >> 12, 0, 11);
	Subframe2[4] = COMPOSE_BITS(IntValue, 20, 12);
	LongValue = UnscaleLong(Eph->M0 / PI, -32);		// M0
	IntValue = (LongValue & 0x100000000LL) ? 1 : 0;
	UintValue = (unsigned int)LongValue;
	Subframe2[4] |= COMPOSE_BITS(IntValue, 19, 1);
	Subframe2[4] |= COMPOSE_BITS(UintValue >> 13, 0, 19);
	Subframe2[5] = COMPOSE_BITS(UintValue, 19, 13);
	ULongValue = UnscaleULong(Eph->ecc, -34);		// ecc
	IntValue = (ULongValue & 0x100000000LL) ? 1 : 0;
	UintValue = (unsigned int)ULongValue;
	Subframe2[5] |= COMPOSE_BITS(IntValue, 18, 1);
	Subframe2[5] |= COMPOSE_BITS(UintValue >> 14, 0, 18);
	Subframe2[6] = COMPOSE_BITS(UintValue, 18, 14);
	LongValue = UnscaleLong(Eph->w / PI, -32);		// w
	IntValue = (LongValue & 0x100000000LL) ? 1 : 0;
	UintValue = (unsigned int)LongValue;
	Subframe2[6] |= COMPOSE_BITS(IntValue, 17, 1);
	Subframe2[6] |= COMPOSE_BITS(UintValue >> 15, 0, 17);
	Subframe2[7] = COMPOSE_BITS(UintValue, 17, 15);
	LongValue = UnscaleLong(Eph->omega0 / PI, -32);	// omega0
	IntValue = (LongValue & 0x100000000LL) ? 1 : 0;
	UintValue = (unsigned int)LongValue;
	Subframe2[7] |= COMPOSE_BITS(IntValue, 16, 1);
	Subframe2[7] |= COMPOSE_BITS(UintValue >> 16, 0, 16);
	Subframe2[8] = COMPOSE_BITS(UintValue, 16, 16);
	LongValue = UnscaleLong(Eph->i0 / PI, -32);		// i0
	IntValue = (LongValue & 0x100000000LL) ? 1 : 0;
	UintValue = (unsigned int)LongValue;
	Subframe2[8] |= COMPOSE_BITS(IntValue, 15, 1);
	Subframe2[8] |= COMPOSE_BITS(UintValue >> 17, 0, 15);
	Subframe2[9] = COMPOSE_BITS(UintValue, 15, 17);
	IntValue = UnscaleInt(Eph->omega_dot / PI, -44);	// omega dot
	Subframe2[9] |= COMPOSE_BITS(IntValue >> 2, 0, 15);
	Subframe2[10] = COMPOSE_BITS(IntValue, 30, 2);
	IntValue = UnscaleInt(Eph->idot / PI, -44);	// i dot
	Subframe2[10] |= COMPOSE_BITS(IntValue, 15, 15);
	IntValue = UnscaleInt(Eph->cis, -30);	// cis
	Subframe2[10] |= COMPOSE_BITS(IntValue >> 1, 0, 15);
	Subframe2[11] = COMPOSE_BITS(IntValue, 31, 1);
	IntValue = UnscaleInt(Eph->cic, -30);	// cic
	Subframe2[11] |= COMPOSE_BITS(IntValue, 15, 16);
	IntValue = UnscaleInt(Eph->crs, -8);	// crs
	Subframe2[11] |= COMPOSE_BITS(IntValue >> 9, 0, 15);
	Subframe2[12] = COMPOSE_BITS(IntValue, 23, 9);
	IntValue = UnscaleInt(Eph->crc, -8);	// crc
	Subframe2[12] |= COMPOSE_BITS(IntValue >> 1, 0, 23);
	Subframe2[13] = COMPOSE_BITS(IntValue, 31, 1);
	IntValue = UnscaleInt(Eph->cus, -30);	// cus
	Subframe2[13] |= COMPOSE_BITS(IntValue, 10, 21);
	IntValue = UnscaleInt(Eph->cuc, -30);	// cuc
	Subframe2[13] |= COMPOSE_BITS(IntValue >> 11, 0, 10);
	Subframe2[14] = COMPOSE_BITS(IntValue, 21, 11);
	// URA_NED occupies 11 bits
	IntValue = UnscaleInt(Eph->af0, -35);	// af0
	Subframe2[14] |= COMPOSE_BITS(IntValue >> 16, 0, 10);
	Subframe2[15] = COMPOSE_BITS(IntValue, 16, 16);
	IntValue = UnscaleInt(Eph->af1, -48);	// af1
	Subframe2[15] |= COMPOSE_BITS(IntValue >> 4, 0, 16);
	Subframe2[16] = COMPOSE_BITS(IntValue, 28, 4);
	IntValue = UnscaleInt(Eph->af2, -60);	// af2
	Subframe2[16] |= COMPOSE_BITS(IntValue, 18, 10);
	IntValue = UnscaleInt(Eph->tgd, -35);	// TGD
	Subframe2[16] |= COMPOSE_BITS(IntValue, 5, 13);
	IntValue = UnscaleInt(Eph->tgd - Eph->tgd_ext[1], -35);	// ISC_L1CP
	Subframe2[16] |= COMPOSE_BITS(IntValue >> 8, 0, 5);
	Subframe2[17] = COMPOSE_BITS(IntValue, 24, 8);
	IntValue = UnscaleInt(Eph->tgd - Eph->tgd_ext[0], -35);	// ISC_L1CD
	Subframe2[17] |= COMPOSE_BITS(IntValue, 11, 13);
	Subframe2[17] |= COMPOSE_BITS(Eph->week, 2, 8);	// Wn_op
}

void CNav2Bit::LDPCEncode(unsigned int Stream[], int bits[], int SymbolLength, int TableSize, const unsigned int MatrixGen[])
{
	int i, j, RemBits, parity_bit;
	unsigned int AndResult;

	// first assign bits in Stream into bits[]
	for (i = 0; i < SymbolLength / 32; i ++)
		AssignBits(Stream[i], 32, bits + i * 32);
	RemBits = SymbolLength & 0x1f;
	if (RemBits)
		AssignBits(Stream[i] >> (32 - RemBits), RemBits, bits + i * 32);

	// generate LDPC check bits
	for (i = 0; i < SymbolLength; i ++)
	{
		parity_bit = 0;
		for (j = 0; j < TableSize; j ++)
		{
			AndResult = Stream[j] & (*MatrixGen ++);
			parity_bit ^= XorBits(AndResult);
		}
		bits[SymbolLength + i] = parity_bit;
	}
}

int CNav2Bit::XorBits(unsigned int Data)
{
	Data ^= (Data >> 1);
	Data ^= (Data >> 2);
	Data ^= (Data >> 4);
	Data ^= (Data >> 8);
	Data ^= (Data >> 16);
	return (int)(Data & 1);
}
